#!/usr/bin/env python3
import sys

def main():
    data = sys.stdin.read().strip().split()
    if not data:
        return
    it = iter(data)
    R = int(next(it)); B = int(next(it))
    rebels = [(int(next(it)), int(next(it))) for _ in range(R)]
    bases = [(int(next(it)), int(next(it))) for _ in range(B)]
    if R != B:
        print("No")
        return
    n = R
    rebels_sorted = sorted(rebels)
    bases_sorted = sorted(bases)
    # Check if can match by x-order (noncrossing): sort by x then y and compare order
    # We need to check existence of noncrossing perfect matching between two equal-sized point sets in general position.
    # For planar bipartite with straight segments, a necessary and sufficient condition is that there exists a permutation with no crossings.
    # For small n (<=10) we can brute-force permutations and check crossings.
    from itertools import permutations
    def cross(a,b,c,d):
        (x1,y1),(x2,y2),(x3,y3),(x4,y4)= (a,b,c,d)
        def orient(p,q,r):
            return (q[0]-p[0])*(r[1]-p[1]) - (q[1]-p[1])*(r[0]-p[0])
        o1 = orient(a,c,d)
        o2 = orient(b,c,d)
        o3 = orient(c,a,b)
        o4 = orient(d,a,b)
        return o1*o2<0 and o3*o4<0
    for perm in permutations(range(n)):
        ok = True
        for i in range(n):
            for j in range(i+1,n):
                if cross(rebels[i], bases[perm[i]], rebels[j], bases[perm[j]]):
                    ok = False
                    break
            if not ok:
                break
        if ok:
            print("Yes")
            return
    print("No")

if __name__ == "__main__":
    main()
